<!DOCTYPE html>
<html lang="id">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Input Nilai Kokurikuler</title>
    <link rel="icon" type="image/x-icon" href="https://lh3.googleusercontent.com/d/1_4llqCMNoBDmwDHsI7RYsCM6rSK5wEjw">
    <link rel="stylesheet" href="style.css">
    
    <script src="https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.2.7/pdfmake.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.2.7/vfs_fonts.js"></script>

    <style>
        .title-wrapper { display: flex; align-items: center; gap: 20px; border-bottom: 2px solid var(--primary-color); padding-bottom: 10px; margin-bottom: 20px; }
        .title-wrapper h1 { margin: 0; padding: 0; border-bottom: none; flex-grow: 1; }
        .home-link { display: inline-flex; align-items: center; justify-content: center; color: var(--secondary-color); transition: all 0.2s ease-in-out; flex-shrink: 0; text-decoration: none; }
        .home-link:hover { transform: scale(1.15); color: var(--primary-color); }
        .home-link svg { width: 32px; height: 32px; }
        .container { max-width: 95%; }
        .table-wrapper { width: 100%; max-height: 70vh; overflow: auto; border: 1px solid var(--border-color); }
        table { width: 100%; border-collapse: collapse; }
        th, td { text-align: center; padding: 10px; border: 1px solid var(--border-color); vertical-align: middle; }
        thead th { position: sticky; top: 0; background-color: var(--primary-color); color: white; z-index: 2; white-space: normal; }
        td select { width: 100%; padding: 8px; border-radius: 5px; border: 1px solid #ccc; box-sizing: border-box; }
        td.col-deskripsi { text-align: left; font-size: 0.9em; white-space: normal; }
        .action-button-container { padding-top: 20px; display: flex; gap: 10px; }
        .header-controls { display: flex; flex-direction: column; gap: 5px; align-items: center; }
        .header-controls select { font-size: 0.8em; padding: 2px; border-radius: 4px; color: black; }
        .predikat-list { display: flex; flex-direction: column; gap: 10px; max-height: 40vh; overflow-y: auto; margin-bottom: 15px; }
        .predikat-item { display: flex; align-items: center; gap: 10px; }
        .predikat-item input { flex-grow: 1; }
        #appModal .modal-content { max-width: 800px; }
    </style>
</head>
<body>
    <div class="container">
        <div class="title-wrapper">
             <a href="bangbin_Rapor.html" class="home-link" title="Kembali ke Menu Utama">
                <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="2" stroke="currentColor"><path stroke-linecap="round" stroke-linejoin="round" d="m2.25 12 8.954-8.955c.44-.439 1.152-.439 1.591 0L21.75 12M4.5 9.75v10.125c0 .621.504 1.125 1.125 1.125H9.75v-4.875c0-.621.504-1.125 1.125-1.125h2.25c.621 0 1.125.504 1.125 1.125V21h4.125c.621 0 1.125-.504 1.125-1.125V9.75M8.25 21h7.5" /></svg>
            </a>
            <h1 id="judulKoku">Input Nilai Kokurikuler</h1>
            <button id="simpanKoku">Simpan</button>
            <button id="downloadPdfButton">PDF</button>            
            <button id="tutorialKokuButton" title="Panduan Halaman Ini" class="icon-button" style="background: none; border: none; cursor: pointer; padding: 5px;">
                <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor" style="width: 25px; height: 25px; color: var(--secondary-color);"><path fill-rule="evenodd" d="M18 10a8 8 0 1 1-16 0 8 8 0 0 1 16 0Zm-8-5a.75.75 0 0 1 .75.75v.5a.75.75 0 0 1-1.5 0v-.5A.75.75 0 0 1 10 5Zm0 10a1 1 0 1 0 0-2 1 1 0 0 0 0 2ZM8.25 9.75a.75.75 0 0 0 0 1.5h.25a.75.75 0 0 0 .75-.75V9a.75.75 0 0 0-.75-.75h-.5a.75.75 0 0 0 0 1.5h.25v.75h-.25Z" clip-rule="evenodd" /></svg>
            </button>
            <button id="bukaModalPredikat" title="Sesuaikan Predikat untuk Tema Ini" class="icon-button" style="background: none; border: none; cursor: pointer; padding: 5px;">
                <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor" style="width: 25px; height: 25px; color: var(--secondary-color);"><path d="m5.433 13.917 1.262-3.155A4 4 0 0 1 7.58 9.42l6.92-6.918a2.121 2.121 0 0 1 3 3l-6.92 6.918c-.383.383-.84.685-1.343.886l-3.154 1.262a.5.5 0 0 1-.65-.65Z" /><path d="M3.5 5.75c0-.69.56-1.25 1.25-1.25H10A.75.75 0 0 0 10 3H4.75A2.75 2.75 0 0 0 2 5.75v9.5A2.75 2.75 0 0 0 4.75 18h9.5A2.75 2.75 0 0 0 17 15.25V10a.75.75 0 0 0-1.5 0v5.25c0 .69-.56 1.25-1.25 1.25h-9.5c-.69 0-1.25-.56-1.25-1.25v-9.5Z" /></svg>
            </button>
        </div>
        <p>Pilih predikat untuk setiap dimensi. Deskripsi capaian akan dibuat secara otomatis.</p>
        <div class="table-wrapper">
            <table id="tabelKoku">
                <thead id="tabelKokuHead"></thead>
                <tbody id="tabelKokuBody"></tbody>
            </table>
        </div>

    </div>

    <div id="predikatModal" class="modal-backdrop" style="display: none;">
        <div class="modal-content">
            <h3 id="predikatModalTitle">Sesuaikan Predikat</h3>
            <div id="predikatList" class="predikat-list"></div>
            <button id="tambahPredikat" type="button" style="margin-bottom: 20px;">+ Tambah Predikat</button>
            <div class="modal-actions">
                <button id="simpanPredikat" class="modal-button">Simpan Perubahan</button>
                <button id="tutupModalPredikat" class="modal-button danger" style="background-color:#6c757d;">Tutup</button>
            </div>
        </div>
    </div>
